import React, { Component } from "react";

import { Dashboard as DashboardLayout } from "layouts";

export default class StudyMaterial extends Component {
	render() {
		return (
			<DashboardLayout title="Study Material">
				<div> Study material List </div>
			</DashboardLayout>
		);
	}
}
